import * as CgIcons from "react-icons/cg";

function Search() {
    return(
        <form action="/" method="get">
            <label htmlFor="header-search">
                <span className="a"></span>
            </label>
            <input
                type="text"
                id="header-search"
                placeholder="search..."
                name="b">
            </input>
            <button type="submit"><CgIcons.CgSearch /></button>          
        </form>
    )
}

export default Search;
